import React, { Fragment } from 'react';
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";

const Navigation = () => {
    return (
      <Fragment>
        <Navbar bg="dark" variant="dark">
          <Navbar.Brand href="/">Las poesías de la abuela</Navbar.Brand>
          <Nav className="mr-auto">
            <Nav.Link href="/poesias">Poesías</Nav.Link>
          </Nav>
          <Nav>
            <Nav.Link href="/iniciar-sesion">Iniciar sesión</Nav.Link>
            <Nav.Link href="/cerrar-sesion" onClick={this.logout}>Cerrar sesión</Nav.Link>
            <Nav.Link href="/registro">Registro</Nav.Link>
          </Nav>
        </Navbar>
      </Fragment>
    );
}

export default Navigation;
